answer:
Reformatted Question: In the diagram below, we have $<fact1>\sin \angle RPQ = \frac{7}{25}</fact1>$.  What is $<fact2>\cos \angle RPS</fact2>$?

[asy]

pair R,P,Q,SS;

SS = (-2,0);

P = (0,0);

Q = (2,0);

R = rotate(aSin(7/25))*(1.5,0);

dot("$S$",SS,S);

dot("$Q$",Q,S);

dot("$R$",R,N);

dot("$P$",P,S);

draw(Q--SS);

draw(P--R);

[/asy]
Answer: Since $<fact1>\sin \angle RPQ = \frac{7}{25}</fact1>$, and we know that $\sin^2 \theta + \cos^2 \theta = 1$, we can find $\cos \angle RPQ$ using this identity. We have $\cos^2 \angle RPQ = 1 - \sin^2 \angle RPQ = 1 - \left(\frac{7}{25}\right)^2 = 1 - \frac{49}{625} = \frac{576}{625}$. Taking the square root of both sides, we get $\cos \angle RPQ = \pm \sqrt{\frac{576}{625}} = \pm \frac{24}{25}$. However, since $\angle RPQ$ is acute, $\cos \angle RPQ$ must be positive, so $\cos \angle RPQ = \frac{24}{25}$. Now, notice that $\angle RPS$ and $\angle RPQ$ are supplementary, so $\cos \angle RPS = -\cos \angle RPQ = -\frac{24}{25}$. Therefore, $<fact2>\cos \angle RPS = -\frac{24}{25}</fact2>$.

